 void Write_Time(){

  // RTCC registers unlock procedure
  SYSKEY = 0xAA996655;      // Write first unlock key to SYSKEY
  SYSKEY = 0x556699AA;      // Write second unlock key to SYSKEY   Section 5. Flash Programming   page 11

  RTCWREN_bit = 1;          // RTC Value registers can be written to by the user

  ON_RTCCON_bit = 0;        // Turn off the RTCC module

  while(RTCCON&RTCCLKON_bit);   // Wait for clock to be turned off

  temp_time = (unsigned long)Dec2Bcd(RTCC_Time = hours2) << 24;
  temp_time += (unsigned long)Dec2BCD(RTCC_Time = minutes2) << 16;
  temp_time += (unsigned long)Dec2BCD(RTCC_Time = seconds2) << 8;

  temp_date = (unsigned long)Dec2Bcd(RTCC_Time = years2) << 24;
  temp_date += (unsigned long)Dec2BCD(RTCC_Time = months2) << 16;
  temp_date += (unsigned long)Dec2BCD(RTCC_Time = date3) << 8;
  temp_date += (unsigned long)Dec2BCD(RTCC_Time = weekday2);


  RTCTIME = temp_time;
  RTCDATE = temp_date;           // Set date


  ON_RTCCON_bit= 1;        // Turn on the RTCC module

  while(!(RTCCON&0x40));     // Wait for clock to be turned on

 //RTCCON = 0b10000000001000001001001000;   //does not work with ECH144

   RTCCONBITS.CAL = 0b1000000000;
   CAL9_BIT = 1;
   SYSKEY = 0x0;

 }


