void Set_Display_Pacman(unsigned int X_Position, unsigned int Y_Position){

     unsigned int Set_Start_Column = 0x00 | X_Position;
     unsigned int Set_Start_Row = 0x00 | Y_position;

     unsigned int Set_End_Column = Set_Start_Column + 104-1; //(bytes -1 bit) 8 pixels = 1 byte, 16 pixels = 2 bytes
     unsigned int Set_End_Row = Set_Start_Row + 105;

     TFT_CS = 0;
     Write_Command_SSD1963(0x2A);  //Set Start Column      // 0x2A                                               D/C = 0;
     Write_Data_SSD1963(Set_Start_column>>8);  // SC[15:8] : Start column number high byte (POR = 00000000)                  D/C = 1;
     Write_Data_SSD1963(Set_Start_column);   // SC[7:0] : Start column number low byte (POR = 00000000)                     D/C = 1;
     Write_Data_SSD1963(Set_End_Column>>8);  // EC[15:8] : End column number high byte (POR = 00000000)                    D/C = 1;
     Write_Data_SSD1963(Set_End_Column);  // EC[7:0] : End column number low byte (POR = 00000000)                       D/C = 1;

     Write_Command_SSD1963(0x2B);   // SET ROW ADDRESS                                                  D/C = 0;
     Write_Data_SSD1963(Set_Start_Row>>8);   //   SP[15:8] : Start page (row) number high byte (POR = 00000000)  D/C = 1;
     Write_Data_SSD1963(Set_Start_Row);   //   SP[7:0] : Start page (row) number low byte (POR = 00000000)     D/C = 1;
     Write_Data_SSD1963(0x01);   //   EP[15:8] : End page (row) number high byte (POR = 00000000)    D/C = 1;
     Write_Data_SSD1963(0xE0);   ///  EP[7:0] : End page (row) number low byte (POR = 00000000)      D/C = 1;

     Write_Command_SSD1963(0x2C);   //WRITE MEMORY START
    // Write_Command_SSD1963(0x3C);   //WRITE MEMORY CONTINUE

     TFT_CS = 1;
}




